import React, { useState } from "react";
import Server from "./server/server";
import Navbar from "./navbar";
const Dashboard = () => {
  const [main, setMain] = useState("server");
  return (
    <div className="" style={{ maxWidth: "1300px", minHeight: "100%" }}>
      <Navbar setMain={setMain}></Navbar>
      {main === "server" ? (
        <Server></Server>
      ) : main === "users" ? (
        // <Users></Users>
        <div></div>
      ) : (
        <div></div>
        // <Stats></Stats>
      )}
    </div>
  );
};

export default Dashboard;
